import styled from "@emotion/styled";

export const MusicShortWrapper = styled.div`
    box-shadow: -2px 2px 10px #181818;
    padding: 1em;
    width: 25em;
    margin: 1em 0 0 0;
    border-radius: .5em;
    text-align: center;
    h1 {
        font-size: 2em;
        text-align: center;
        margin-top: 1.5%;
    }
`
